import React from "react";
import NavBar from "./components/NavBar";
import Banner from "./components/Banner";
import Movies from "./components/Movies";
import Favourite from "./components/Favourite";
import "./App.css";

function App() {
  return (
    <>
      <NavBar />
      <Banner />
      <Movies />
      <Favourite />
    </>
  );
}
export default App;
